import { Component, OnInit } from '@angular/core';
import { PokemonService } from '../_services/pokemon/pokemon.service';
import { PokemonModel, StatsModel } from '../model/pokemon-model.model';

@Component({
  selector: 'app-player',
  templateUrl: './player.component.html',
  styleUrls: ['./player.component.scss']
})
export class PlayerComponent implements OnInit{
  constructor(private http: PokemonService) { }
  myPokemon: PokemonModel


  ngOnInit(): void {
    console.log(this.http.getPokemon('658'))
    this.http.getPokemon('658').subscribe(data => {


      this.myPokemon = {
        id: data.id,
        name: data.name,
        stats: [
          {
            base_stat: data.stats[0].base_stat,
            name: data.stats[0].name
          }
        ]
      }
    })
  }
}
